	var $body = $('body'),
		mobileWidth = 667,
		tabletWidth = 1024;



	function initHeadroom() {
		var myElement = document.querySelector(".header");
		var headroom  = new Headroom(myElement, {
			"offset": 0,
			"tolerance": 5
		});
		headroom.init(); 
	}

	function initLazyImages() {
		$('img.lazy').lazyload({
			// effect : "fadeIn",
			threshold: 400,

			load: function(elements_left, settings) {
				
			}
		});
	}

	function initNewsGallery() {
		var $newsGallery = $('.news-wrapper').flickity({
			pageDots: false,
			cellAlign: 'left',
			wrapAround: true,
			imagesLoaded: false,
			percentPosition: true,
			lazyLoad: false,
			adaptiveHeight: false,
			groupCells: true,
			selectedAttraction: 1,
			friction: 1,
			draggable: false,
		});
		var newsFlkty = $newsGallery.data('flickity');

		$('video').each(function() {
			$(this).get(0).play();
		});

		$('.news__item__prev-next-button.prev').click(function() {
			$newsGallery.flickity('previous');
		});
		$('.news__item__prev-next-button.next').click(function() {
			$newsGallery.flickity('next');
		});


		setNewsHeightOnMobile();
		$(window).resize(setNewsHeightOnMobile);

		function setNewsHeightOnMobile() {
			if ( $(window).width() < mobileWidth ) {

				var headerHeight = $('.header').height(),
					preceptLogoHeight = $('.logo-home-nick').height(),
					windowHeight = $(window).height(),
					siteMargin = 13,
					newsCalculatedHeight = windowHeight - headerHeight - preceptLogoHeight - siteMargin*3;
				
				$('.news__item').css('height', newsCalculatedHeight);
				$('.news-wrapper').find('.flickity-viewport').css('height', newsCalculatedHeight);

			} else if ( $(window).width() < tabletWidth ) {

				if ( $('html').hasClass('touchevents') ) {
					
					var windowHeight = $(window).height();

					$('.news__item').css('height', windowHeight);
					$('.news-wrapper').find('.flickity-viewport').css('height', windowHeight);

				}

			} else {
				$('.news__item').css('height', '100vh')
			}
		}
	}

	
	function initGallery() {
		function withLeadingZeros(str, max) {
			str = str.toString();
			return str.length < max ? withLeadingZeros("0" + str, max) : str;
		}
		
		var $releaseGallery = $('.gallery-wrapper').flickity({
			pageDots: false,
			cellAlign: 'left',
			wrapAround: true,
			imagesLoaded: true,
			percentPosition: true,
			lazyLoad: 2,
			adaptiveHeight: true,
			selectedAttraction: 1,
			friction: 1,
			accessibility: false,
			// watchCSS: true,
			draggable: false,
			// asNavFor: '.lightbox-gallery',
		});
		var $releaseGalleryCount = $('.release__gallery__info__count'),
			$releaseGalleryCaption = $('.release__gallery__info__caption'),
			releaseGalleryFlkty = $releaseGallery.data('flickity');

		function setReleaseGalleryTotal() {
			var totalCellsCount = $('.release__gallery__item').length;
			$('.release__gallery__info__total').text( withLeadingZeros(totalCellsCount, 2) );
		}
		setReleaseGalleryTotal();

		function updateReleaseGalleryStatus() {
			var cellNumber = releaseGalleryFlkty.selectedIndex + 1,
				cellCaption = $(releaseGalleryFlkty.selectedElement).attr('data-caption');
			$releaseGalleryCount.text( withLeadingZeros(cellNumber, 2) );
			$releaseGalleryCaption.text(cellCaption);
		}
		updateReleaseGalleryStatus();
		$releaseGallery.on('select.flickity', updateReleaseGalleryStatus );

		// Show the gallery once its initialized
		$releaseGallery.parent().css({ opacity: 1 });
		$releaseGallery.on('select.flickity', function() {
			$releaseGallery.parent().css({ opacity: 1 });
		});

		
		$('.release__gallery__item').each(function() {
			var $this = $(this),
				$image = $this.find('.release__gallery__item__image'),
				$placeholder = $this.find('.release__gallery__item__placeholder');

			$placeholder.css('width', $image.width()).css('height', $image.height());

			$(window).resize(function() {
				$placeholder.css('width', $image.width()).css('height', $image.height());
			})
		});

		if ($(window).width() < mobileWidth) {
			$('.release__gallery__item').click(function() {
				$releaseGallery.flickity('next');
			})
		}
	}

	
		$(document).keydown(function(e) {
			if(e.keyCode == 27) { // escape
				$body.removeClass('body-lightbox-is-open');
			}  
		});
		$('.lightbox-gallery__close').click(function() {
			$body.removeClass('body-lightbox-is-open');
		});



		$('.lightbox-gallery__item').each(function() {
			var $this = $(this),
				$image = $this.find('.lightbox-gallery__item__image'),
				$placeholder = $this.find('.lightbox-gallery__item__placeholder');

			$placeholder.css('width', $image.width()).css('height', $image.height());

			$(window).resize(function() {
				$placeholder.css('width', $image.width()).css('height', $image.height());
			})
		});


	


	function init() {
		initHeadroom();
		
		initLazyImages();
		

		if ($body.hasClass('body-template--home')) {
			initNewsGallery();
		} 
	}
	init();



